--------------------------------------------------------------------------------
-- Generating expressions

choose :: [a] -> IO a
choose xs = (xs !!) `fmap` getStdRandom (randomR (0, n - 1))
  where n = length xs

iconst, bconst :: IO Expr
iconst = IConst `fmap` getStdRandom (randomR (-100, 100))
bconst = BConst `fmap` getStdRandom (randomR (False, True))

conditional :: Bool -> Int -> (Bool -> Int -> IO Expr) -> IO Expr
conditional typed n bodyGen = liftM3 If (gen typed (n - 1)) (bodyGen typed (n - 1)) (bodyGen typed (n - 1))
  where gen | typed = boolop
            | otherwise = anyop

intop :: Bool -> Int -> IO Expr
intop _ 0 = iconst
intop typed n = join (choose [iconst, binop Plus, binop Times, unop Negate, conditional typed n intop])
  where binop f = liftM2 f (gen typed (n - 1)) (gen typed (n - 1))
        unop f  = fmap f (gen typed (n - 1))
        gen | typed = intop
            | otherwise = anyop 
                     
boolop :: Bool -> Int -> IO Expr
boolop _ 0 = bconst
boolop typed n = join (choose [bconst, conditional typed n boolop])

anyop :: Bool -> Int -> IO Expr
anyop typed n = join (choose [intop typed n, boolop typed n])

--------------------------------------------------------------------------------
-- The actual tests
--------------------------------------------------------------------------------

test1, test2 :: Test

test1 = test [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (expected == actual) | (e, expected) <- evaluated, let actual = eval e ]

test2 = test [ assertBool ("Evaluating (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- noEval, let actual = eval e ]

test3, test4 :: Test

test3 = test [ assertBool ("Typing (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (expected == actual) | (e, expected) <- wellTyped, let actual = typed e ]

test4 = test [ assertBool ("Typing (" ++ show e ++ ") should fail, but you have (" ++ show actual ++ ")") (isNothing actual) | e <- noType, let actual = typed e ]

test5 :: Test
test5 = test [ assertBool "Problem 5 solution should evaluate" (isJust (eval evalsNotTyped))
             , assertBool "Problem 5 solution should not type" (isNothing (typed evalsNotTyped)) ]

test6 :: Test
test6 = test $
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (expected == actual) | (e, expected) <- intGExprs, let actual = geval e ] ++
        [ assertBool ("Evaluating (" ++ show e ++ ") should give (" ++ show expected ++ " but you have (" ++ show actual ++ ")") (expected == actual) | (e, expected) <- boolGExprs, let actual = geval e ]


